  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Strapline Animation</title>

    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      :root {
        --sampleValue: 0.3s;
      }

      .parentDiv {
        min-height: 100vh;
        background-color: chocolate;
        display: grid;
        place-items: center;
      }

      #logo path {
        stroke-width: 1px;
        stroke-dasharray: 190%;
        stroke-dashoffset: 190%;
        animation: sample var(--sampleValue) ease-in-out 1 forwards;
      }

      @keyframes sample {
        to {
          stroke-width: 0px;
          fill: white;
          stroke-dashoffset: 0%;
        }
      }

      #logo path:nth-child(1) {
        animation-delay: calc(var(--sampleValue) + 0.1s);
      }
      #logo path:nth-child(2) {
        animation-delay: calc(var(--sampleValue) + 0.2s);
      }
      #logo path:nth-child(3) {
        animation-delay: calc(var(--sampleValue) + 0.3s);
      }
      #logo path:nth-child(4) {
        animation-delay: calc(var(--sampleValue) + 0.4s);
      }
      #logo path:nth-child(5) {
        animation-delay: calc(var(--sampleValue) + 0.5s);
      }
      #logo path:nth-child(6) {
        animation-delay: calc(var(--sampleValue) + 0.6s);
      }
      #logo path:nth-child(7) {
        animation-delay: calc(var(--sampleValue) + 0.7s);
      }
      #logo path:nth-child(8) {
        animation-delay: calc(var(--sampleValue) + 0.8s);
      }
      #logo path:nth-child(9) {
        animation-delay: calc(var(--sampleValue) + 0.9s);
      }
      #logo path:nth-child(10) {
        animation-delay: calc(var(--sampleValue) + 1s);

      #logo path:nth-child(11) {
        animation-delay: calc(var(--sampleValue) + 1.1s);

      #logo path:nth-child(12) {
        animation-delay: calc(var(--sampleValue) + 1.2s);
      }
      #logo path:nth-child(13) {
        animation-delay: calc(var(--sampleValue) + 1.3s);
      }
      #logo path:nth-child(14) {
        animation-delay: calc(var(--sampleValue) + 1.4s);
      }
